import express from 'express'
import mongoose from 'mongoose';
import bodyParser from 'body-parser';
import dotenv from 'dotenv'
import cors from 'cors'
import session from 'express-session';
import MongoStore from 'connect-mongo';

import accidenteRoutes from './routes/accidente.js'
import usuarioRoutes from './routes/usuario.js'

const app = express();
const PORT = process.env.PORT || 5000;
dotenv.config()

//middleware
app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: true }))

//cors
app.use(cors());

// Configuración de Sesiones
app.use(session({
  secret: process.env.SESSION_SECRET,
  resave: false,
  saveUninitialized: false,
  store: MongoStore.create({ mongoUrl: process.env.MONGO_URI }),
  cookie: {
    secure: process.env.NODE_ENV === 'production', // Asegúrate de usar HTTPS en producción
    httpOnly: true,
    maxAge: 24 * 60 * 60 * 1000 // 1 día
  }
}));

// Usar rutas
app.use('/api/accidentes', accidenteRoutes);
app.use('/api/usuarios', usuarioRoutes);

// Conexión a MongoDB
mongoose.connect('mongodb://127.0.0.1:27017/accidentes')
  .then(() => console.log('MongoDB connected'))
  .catch(err => console.log(err));

// Iniciar el servidor
app.listen(PORT, () => {
  console.log(`Server running on port ${PORT}`);
});

