sourcesContent:
import Transito from '../models/Transito.js';

export const createTransito = async (req, res) => {
  const { hechos, vehiculo, conductores, detalle, victima, usuario } = req.body;

  try {
    const newTransito = new Transito({ hechos, vehiculo, conductores, detalle, victima, usuario });
    await newTransito.save();
    res.status(201).json(newTransito);
  } catch (err) {
    res.status(500).json({ error: 'Server error', details: err.message });
  }
};

export const getTransitos = async (req, res) => {
  try {
    const transitos = await Transito.find();
    res.status(200).json(transitos);
  } catch (err) {
    res.status(500).json({ error: 'Server error', details: err.message });
  }
};

