sourcesContent:
import Accidente from '../models/Accidente';

export const createAccidente = async (req, res) => {
  const { hechos, vehiculo, conductores, detalle, victima, usuario } = req.body;

  try {
    const newAccidente = new Accidente({ hechos, vehiculo, conductores, detalle, victima, usuario });
    await newAccidente.save();
    res.status(201).json(newAccidente);
  } catch (err) {
    res.status(500).json({ error: 'Server error', details: err.message });
  }
};

export const getAccidentes = async (req, res) => {
  try {
    const accidentes = await Accidente.find();
    res.status(200).json(accidentes);
  } catch (err) {
    res.status(500).json({ error: 'Server error', details: err.message });
  }
};

