sourcesContent:
import mongoose from 'mongoose';

const AccidenteSchema = new mongoose.Schema({
  hechos: { type: String, required: true, maxlength: 1000},
  vehiculo: String,
  conductores: String,
  detalle: { type: String, maxlength: 1000 },
  victima: String,
  usuario: String
}, {
  collection: 'formularios'
});

const Accidente = mongoose.model('Accidente', AccidenteSchema);

export default Accidente;

