sourcesContent:
import mongoose from 'mongoose';

const { Schema } = mongoose

const AccidenteSchema = new Schema({
  hechos: { 
    type: String, 
    required: true, 
    maxlength: 1000
  },
  vehiculos: { 
    type: [String], 
    required: true 
  },
  conductores: { 
    type: [String], 
    required: true 
  },
  detalle: { 
    type: String, 
    maxlength: 1000,
    require: true 
  },
  victima: {
    type: String, 
    required: true,
  },
  usuario: {
    type: String, 
    required: true,
  },
  fechaAccidente: { 
    type: Date, 
    required: true 
  },
  fechaRegistro: { 
    type: Date, 
    default: Date.now, 
    required: true
  }
});

const Accidente = mongoose.model('Accidente', AccidenteSchema);

export default Accidente;

