import Usuario from '../models/Usuario.js';
import bcrypt from 'bcryptjs';
import { generateToken } from '../auth/jwtAuth.js';
import { encryptData, decryptData } from '../auth/cryptoUtils.js';

// Crear nuevo usuario
export const registerUsuario = async (req, res) => {
  const { nombre, apellidos, carnet, grado, usuario, password } = req.body;

  try {
    const existingUser = await Usuario.findOne({ usuario: encryptData(usuario) });
    if (existingUser) {
      return res.status(400).json({ message: 'Usuario ya existe' });
    }

    const hashedPassword = await bcrypt.hash(password, 12);
    const newUsuario = new Usuario({ 
      nombre: encryptData(nombre), 
      apellidos: encryptData(apellidos), 
      carnet: encryptData(carnet), 
      grado: encryptData(grado), 
      usuario: encryptData(usuario), 
      password: hashedPassword 
    });

    await newUsuario.save();
    res.status(201).json({ message: 'Usuario registrado exitosamente' });
  } catch (err) {
    console.error('Error al registrar el usuario:', err);
    res.status(500).json({ message: 'Error del servidor', details: err.message });
  }
};

// Inicio de sesión
export const loginUsuario = async (req, res) => {
  const { usuario, password } = req.body;

  try {
    const user = await Usuario.findOne({ usuario: encryptData(usuario) });
    if (!user) {
      return res.status(400).json({ message: 'Usuario incorrecto' });
    }

    const isPasswordValid = await bcrypt.compare(password, user.password);
    if (!isPasswordValid) {
      return res.status(400).json({ message: 'Contraseña incorrecta' });
    }

    const token = generateToken(user)
    res.status(200).json({ message: 'Inicio de sesión exitoso', token });
  } catch (err) {
    console.error('Error al iniciar sesión:', err);
    res.status(500).json({ message: 'Error del servidor', details: err.message });
  }
};

// Obtener todos los usuarios
export const getUsuarios = async (req, res) => {
  try {
    const usuarios = await Usuario.find();
    const decryptedUsuarios = usuarios.map(user => ({
      ...user._doc,
      nombre: decryptData(user.nombre),
      apellidos: decryptData(user.apellidos),
      carnet: decryptData(user.carnet),
      grado: decryptData(user.grado),
      usuario: decryptData(user.usuario)
    }));
    res.json(decryptedUsuarios);
  } catch (error) {
    console.error('Error al obtener los usuarios:', error);
    res.status(500).json({ error: 'Error al obtener los usuarios' });
  }
};

