import crypto from 'crypto';

// Genera una clave de 32 bytes a partir de la variable de entorno
const algorithm = 'aes-256-cbc';
const key = crypto.randomBytes(32); // La clave debe tener 32 bytes para AES-256
const iv = crypto.randomBytes(16); // El IV debe tener 16 bytes


// Función para desencriptar datos
export function decryptData(data) {
  try {
    const textParts = data.split(':');
    const iv = Buffer.from(textParts.shift(), 'hex');
    const encryptedText = textParts.join(':');
    const decipher = crypto.createDecipheriv(algorithm, key, iv);
    let decrypted = decipher.update(encryptedText, 'hex', 'utf-8');
    decrypted += decipher.final('utf-8');
    return decrypted;
  } catch (err) {
    console.error('Error al desencriptar los datos:', err);
    throw err;
  }
}

// Función para encriptar datos
export function encryptData(data) {
  const cipher = crypto.createCipheriv(algorithm, key, iv);
  let encrypted = cipher.update(data, 'utf-8', 'hex');
  encrypted += cipher.final('hex');
  return iv.toString('hex') + ':' + encrypted;
}

